{"type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v4.3.0.json",
  "signals": [
    {
      "name": "window_first_point",
      "value": null,
      "on": [{"events": "window:mousedown", "update": "[x(), y()]"}]
    },
    {
      "name": "window_move",
      "value": null,
      "on": [
        {
          "events": "[window:mousedown, window:mouseup] > window:mousemove",
          "update": "[x(), y()]"
        }
      ]
    },
    {
      "name": "x_y_new_coord",
      "value": [0, 0],
      "on": [
        {
          "events": {"signal": "window_move"},
          "update": "[window_move[0] - window_first_point[0] ,window_move[1] - window_first_point[1]]"
        }
      ]
    },
    {
      "name": "graph_rayon",
      "value": 250,
      "on": [
        {
          "events": "wheel",
          "update": "event.deltaY < 0 ? graph_rayon + 50 : graph_rayon - 50"
        }
      ]
    },
    {
      "name": "graph_rayon_borned",
      "value": 250,
      "on": [
        {
          "events": {"signal": "graph_rayon"},
          "update": "graph_rayon < 10 ? 10 : graph_rayon > width/2 ? width/2 : graph_rayon"
        }
      ]
    },
    {
      "name": "symbol_size",
      "value": 200,
      "on": [{"events": "wheel", "update": "symbol_size - event.deltaY"}]
    },
    {
      "name": "symbol_size_borned",
      "value": 200,
      "on": [
        {
          "events": {"signal": "graph_rayon"},
          "update": "symbol_size < 10 ? 10 : symbol_size > 200 ? 200 : symbol_size"
        }
      ]
    }
  ],
  "data": [
    {
      "name": "nodes",
      "url": {
        "index": "*spark-metrics-*",
        "body": {
          "size": 0,
          "query": {
            "bool": {
              "must": [
                "%dashboard_context-must_clause%",
                {
                  "range": {
                    "labels.event.timestamp": {
                      "gte": {"%timefilter%": "min"},
                      "lte": {"%timefilter%": "max"}
                    }
                  }
                },
                {"exists": {"field": "labels.event.host"}},
                {"exists": {"field": "labels.application.driver_host"}}
              ],
              "must_not": ["%dashboard_context-must_not_clause%"]
            }
          },
          "aggs": {
            "driver": {
              "terms": {"field": "labels.application.driver_host", "size": 100},
              "aggs": {"task": {"terms": {"field": "labels.event.host", "size": 100}}}
            }
          }
        }
      },
      "format": {"property": "aggregations.driver.buckets"},
      "transform": [
          {"type": "identifier", "as": "uid"},
          {"type": "formula", "expr" : "(datum.uid - 1) - (datum.uid - 1)/2", "as": "x_raw"},
          {"type": "formula", "expr" : "datum.x_raw % 2", "as": "y_col"},

          {"type": "flatten", "fields": ["task.buckets"], "as" : ["task"]},
          {"type" : "project", "fields" : ["key", "task.key", "task.doc_count", "x_raw", "y_col"], "as" : ["id", "parent", "task", "x_raw", "y_col"]}

      ]
    },
    {
      "name": "nodes_sample",
      "values": [
        {
          "y_col": 0,
          "x_raw": 0,
          "id": "host-1",
          "parent": "driver-1",
          "task": 1
        },
        {
          "y_col": 0,
          "x_raw": 0,
          "id": "host-2",
          "parent": "driver-1",
          "task": 30
        },
        {
          "y_col": 0,
          "x_raw": 0,
          "id": "host-3",
          "parent": "driver-1",
          "task": 50
        },
        {
          "y_col": 0,
          "x_raw": 0,
          "id": "host-4",
          "parent": "driver-1",
          "task": 100
        },
        {
          "y_col": 0,
          "x_raw": 1,
          "id": "host-1",
