        },
        {
          "y_col": 1,
          "x_raw": 1,
          "id": "host-10",
          "parent": "driver-4",
          "task": 100
        }
      ],
      "transform": []
    }
  ],
  "scales": [
    {
      "name": "xscale",
      "type": "band",
      "domain": {"data": "nodes", "field": "x_raw"},
      "range": "width",
      "padding": 0.1
    },
    {
      "name": "yscale",
      "type": "band",
      "domain": {"data": "nodes", "field": "y_col"},
      "range": "height",
      "padding": 0.1
    }
  ],
  "marks": [
    {
      "type": "group",
      "from": {
        "facet": {
          "data": "nodes",
          "name": "facet",
          "groupby": ["x_raw", "y_col"]
        }
      },
      "encode": {
        "enter": {
          "x": {"scale": "xscale", "field": "x_raw"},
          "y": {"scale": "yscale", "field": "y_col"},
          "width": {"value": 0},
          "height": {"value": 100}
        }
      },
      "data": [
        {
          "name": "graph",
          "source": ["facet"],
          "transform": [
            {
              "type": "formula",
              "expr": "cos(scale('circle', datum.id))*(graph_rayon_borned) + width / 2 + x_y_new_coord[0]",
              "as": "source_x"
            },
            {
              "type": "formula",
              "expr": "sin(scale('circle', datum.id))*(graph_rayon_borned) + height / 2 + x_y_new_coord[1]",
              "as": "source_y"
            },
            {
              "type": "formula",
              "expr": "width / 2 + x_y_new_coord[0]",
              "as": "target_x"
            },
            {
              "type": "formula",
              "expr": "height / 2 + x_y_new_coord[1]",
              "as": "target_y"
            },
            {
              "type": "linkpath",
              "orient": "horizontal",
              "shape": "curve",
              "sourceX": "source_x",
              "sourceY": "source_y",
              "targetX": "target_x",
              "targetY": "target_y",
              "as": "linkpath"
            }
          ]
        }
      ],
      "scales": [
        {
          "name": "circle",
          "type": "band",
          "domain": {"data": "facet", "field": "id"},
          "range": [0, {"signal": "2*PI"}]
        },
        {
          "name": "task_density_scale",
          "type": "linear",
          "domain": {"data": "graph", "field": "task"},
          "range": [1, {"signal": "symbol_size_borned/10"}]
        }
      ],
      "marks": [
        {
          "type": "path",
          "from": {"data": "graph"},
          "encode": {
            "update": {
              "path": {"field": "linkpath"},
              "stroke": {"value": "#ccc"},
              "strokeWidth": {"scale": "task_density_scale", "field": "task"}
            }
          }
        },
        {
          "name": "node_center",
          "type": "symbol",
          "from": {"data": "graph"},
          "encode": {
            "enter": {
              "fill": {"value": "#9B9B9B"},
              "stroke": {"value": "#ffffff"}
            },
            "update": {
              "xc": {"signal": "width / 2 + x_y_new_coord[0]"},
              "yc": {"signal": "height / 2 + x_y_new_coord[1]"},
              "size": {"signal": "symbol_size_borned*10"},
              "shape": {"value": "diamond"},
              "opacity": {"value": 1}
            },
            "hover": {"opacity": {"value": 0.5}}
          }
        },
        {
          "name": "nodes_symbol",
          "type": "symbol",
          "from": {"data": "graph"},
          "encode": {
            "enter": {
              "fill": {"value": "#9B9B9B"},
              "stroke": {"value": "#ffffff"}
            },
            "update": {
              "xc": {"field": "source_x"},
              "yc": {"field": "source_y"},
              "size": {"signal": "symbol_size_borned*10"},
              "shape": {"value": "circle"},
              "opacity": {"value": 1}
            },
            "hover": {"opacity": {"value": 0.5}}
          }
        },
        {
          "type": "text",
          "from": {"data": "graph"},
          "encode": {
            "enter": {
              "text": {"field": "id"},
              "fontSize": {"signal": "symbol_size_borned/10"},
              "baseline": {"value": "middle"}
            },
            "update": {
              "x": {"field": "source_x"},
              "y": {"field": "source_y"},
              "dx": {"signal": "datum.children ? -20 : 20"},
              "align": {"signal": "datum.children ? 'right' : 'left'"}
            }
          }
        },
        {
          "type": "text",
          "from": {"data": "facet"},
          "encode": {
            "enter": {
              "text": {"field": "parent"},
              "fontSize": {"signal": "symbol_size_borned/10"},
              "baseline": {"value": "middle"}
            },
            "update": {
              "x": {"signal": "width / 2 + x_y_new_coord[0]"},
              "y": {"signal": "height / 2 + x_y_new_coord[1]"},
              "dx": {"signal": "datum.children ? -20 : 20"},
              "align": {"signal": "datum.children ? 'right' : 'left'"},
              "opacity": {"signal": "0.5"}
            }
          }
        }
      ]
    }
  ]
